import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "document";
const pathData = "M453 8c5 5 8 10 8 17v460c0 13-11 26-26 26H77c-15 0-25-13-25-26V179c0-8 2-13 8-18L213 8c5-6 10-8 18-8h204c8 0 13 2 18 8zm-43 452V51H241l-10 10v67c0 28-23 51-51 51h-67l-10 10v271h307z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
